Tercer día de declaración de Francisco Correa en el macrojuicio de la trama Gürtel, en directo

La Audiencia Nacional celebra la séptima sesión del macrojuicio por la trama de corrupción Gürtel, jornada clave en la que sigue declarando el presunto cabecilla de la red, Francisco Correa.
A ver si nos enteramos de una vez de que ese dinero de las mordidas lo hemos puesto los ciudadanos. Los sobrecostes de una obra pública salen de nuestros impuestos. Con un grave problema añadido: se destruye la libre competencia que tanto defienden los falsos liberales. No se lo lleva el mejor y más barato, sino el más amigo. Además, con ese latrocinio de dinero público se retiran recursos para generar empleo. Además, se necesita que paguemos más impuestos para cubrir las necesidades del estado, por lo que un pequeño empresario no puede contratar a otro trabajador. ¿Cuánto paro ha generado la corrupción? Lo peor de la corrupción no es la cantidad de dinero robado, sino el destrozo causado en toda la sociedad. Si unos ladrones asaltan una casa a veces el problema no es que te hayan robado 1.000 euros. El problema es que te han destrozado por un valor de 5.000.
Esto es una puñetera farsa, el fiscal está compinchado, como da comisiones a bárcenas y sus jefes mariano rajoy y aznar no sabían nada, no se lo creen ni ellos. Por esto y más, votamos a podemos.
